'use strict'

function substrCount(n, s) {
    const SPECIAL_ALL_SAME = 1, SPECIAL_MIDDLE_DIFFERENT = 2, NOT_SPECIAL_CONTINUE = 3, NOT_SPECIAL_BREAK = 4;

    function isSameChar(substr) {
        let middle = (substr.length % 2 === 0 ? -1 : (substr.length - 1) / 2);
        let char = substr[0];
        for (let i = 1; i < substr.length; i++) {
            if (substr[i] !== char && i !== middle)
                return substr.length === 2 ? NOT_SPECIAL_CONTINUE : NOT_SPECIAL_BREAK;
        }

        if (middle === -1 || substr[middle] === char)
            return SPECIAL_ALL_SAME;
        else
            return SPECIAL_MIDDLE_DIFFERENT;
    }

    if (s.length === 1)
        return 1;

    const S_LENGTH = s.length;
    let count = s.length;
    for (let i = 0; i < S_LENGTH - 1; i++) {
        let substrLen = 2;
        while (i + substrLen <= S_LENGTH) {
            let substr = s.slice(i, i + substrLen);
            let result = isSameChar(substr)
            if (result === NOT_SPECIAL_BREAK)
                break;
            else if (result === SPECIAL_MIDDLE_DIFFERENT) {
                count++;
                break;
            }
            else if (result === SPECIAL_ALL_SAME) {
                count++;
                substrLen++;
            }
            else if (result === NOT_SPECIAL_CONTINUE)
                substrLen++;
        }
    }

    return count;
}

main();
function main() {
    let input = `5
    asasd`;             // expects 7

    // input = `7
    // abcbaba`;           // expects 10

    // input = `4
    // aaaa`;              // expects 10
    input=`93534
    `;
    let lines = input.split('\n').map(l => l.trim()).filter(l => l !== ''), index = 0;
    const n = parseInt(lines[index++], 10), s = lines[index++];

    const result = substrCount(n, s);
    console.log(result);
}
